    } var subsetsWithDup = function(nums) {
    // 定义结果数组和回溯时的路径数组
    let res = [];
    let track = [];

    // 排序，以便于剪枝算法的实现
    nums.sort((a, b) => a - b);

    // 回溯算法
    // @visualize status(track)
    const backtrack = function(nums, start) {
        // 前序位置，每个节点的值都是一个子集
        // @visualize color *backtrack._vizNode #green
        res.push([...track]);

        // 遍历子集树枝
        for (let i = start; i < nums.length; i++) {
            // 剪枝逻辑，值相同的相邻树枝，只遍历第一条
            if (i > start && nums[i] === nums[i - 1]) {
                continue;
            }
            // 选择当前元素，加入路径数组
            // @visualize choose(nums[i])
            track.push(nums[i]);
            // 向子节点递归
            backtrack(nums, i + 1);
            // 回溯，撤销选择
            // @visualize unchoose()
            track.pop();
        }
    }

    backtrack(nums, 0);
    return res;
};

